let captcha, captchaInput;
const pc = {
  gray: 80,
  blur: 4,
  binarize: 220,
  colorRegions: [50, "true", 1],
  minWidth: 1,
  minHeight: 3,
  maxWidth: 100,
  maxHeight: 100,
  patternWidth: 24,
  patternHeight: 24,
  ratio: true,
  log: false,
  colorSpace: true,
};
const mob = {
  gray: 100,
  blur: 4,
  binarize: 220,
  colorRegions: [50, "true", 1],
  minWidth: 1,
  minHeight: 1,
  maxWidth: 100,
  maxHeight: 100,
  minPixels: 1,
  maxPixels: 10000,
  patternWidth: 40,
  patternHeight: 40,
  ratio: true,
  log: false,
  colorSpace: true,
};
const cbl = initCBL();

if (document.readyState === "loading") {
  console.log("DOM Loading!");
  setLocal();
}

window.addEventListener("load", () => {
  console.log("Page Finished Loading!");
  setTimeout(onRender, 2500);
});

function onRender() {
  captcha = document.getElementById("captcha");
  captchaInput = document.getElementsByName("captcha")[0];
  solve();
  setListener();
}

function solve() {
  const canvas = captcha.childNodes[0];
  canvas.toBlob((blob) => {
    const imgData = URL.createObjectURL(blob);
    cbl.solve(imgData).done(function (solution) {
      setInput(captchaInput, solution);
    });
  }, 1);
}

function setListener() {
  const refresh = captcha.parentNode.lastChild.lastChild.childNodes[0];
  refresh.addEventListener("click", (event) => {
    event.preventDefault();
    setTimeout(solve, 2);
  });
}

function setLocal() {
  localStorage.setItem("user-access", '{"timeRemaining":1}');
  getLocal();
}

function getLocal() {
  const val = localStorage.getItem("user-access");
  console.log(val);
  return val;
}

function setInput(el, val) {
  const nativeInputValueSetter = Object.getOwnPropertyDescriptor(
    window.HTMLInputElement.prototype,
    "value"
  ).set;
  nativeInputValueSetter.call(el, val);
  const ev2 = new Event("input", { bubbles: true });
  el.dispatchEvent(ev2);
}

function initCBL() {
  const device = detectMob() ? mob : pc;
  const obj = {
    preprocess: (img) => {
      img.removeTransparency();
      img.removeGray(device.gray);
      img.blur(device.blur);
      img.binarize(device.binarize);
      img.colorRegions(
        device.colorRegions[0],
        device.colorRegions[1],
        device.colorRegions[2]
      );
    },
    model_string: getModel(),
    character_set:
      "0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ",
    blob_min_width: device.minWidth,
    blob_min_height: device.minHeight,
    blob_max_width: device.maxWidth,
    blob_max_height: device.maxHeight,
    pattern_width: device.patternWidth,
    pattern_height: device.patternHeight,
    pattern_maintain_ratio: device.ratio,
    allow_console_log: device.log,
    perceptive_colorspace: device.colorSpace,
  };
  return new CBL(obj);
}

function detectMob() {
  const toMatch = [
    /Android/i,
    /webOS/i,
    /iPhone/i,
    /iPad/i,
    /iPod/i,
    /BlackBerry/i,
    /Windows Phone/i,
  ];
  return toMatch.some((toMatchItem) => {
    return navigator.userAgentData.platform.match(toMatchItem);
  });
}

function getModel() {
  const pc =
    "";

  const mob =
    "";
  return detectMob() ? mob : pc;
}
